import React, { Component } from 'react';
import Login from './Login'
import IntelCeleron from './upgrades/IntelCeleron'
import IntelI5 from './upgrades/IntelI5.js'

export default class Shop extends Component {
  render() {
    return (
    	<div>
	      <IntelCeleron myCoin={this.state.coin} gameFunction={this.upgrade}/>
	      <IntelI5 myCoin={this.state.coin} gameFunction={this.upgrade}/>
      </div>
    );
  }
}
